import { useLocation } from 'react-router-dom';
import './style/info.css'

function Info () {
  const location = useLocation();
  const { team } = location.state;

  return (
    <div className='information'>
      <img  src={team.logo} style={ { width: '150px' } } alt="League logo"/>
      <div className='bold'>Name:
        <h2>{team.name}</h2>
      </div>
      <div className='bold'>
        <h3>{team.city}</h3>
      </div>
      <div className='bold'>
        <h4>{team.founded}</h4>
      </div>
      <div className='bold'>
        <p>{team.details}</p>
      </div>
    </div>
  );
}

export default Info;
